    "Li metal protection for High Energy Space Batteries Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:47:46.578857",nt"name": "li-metal-protection-for-high-energy-space-batteries-project",nt"isopen":
    true,nt"url": null,nt"notes": "NOHMs Technologies proposes to develop a
    novel ionic liquid electrolyte formulation developed for the Lithium-Sulfur chemistry
    that can protect the lithium metal and has demonstrated superior performance and
    safety characteristics with the potential to offer 600 Wh/kg on the cell level.
    For this NASA Phase I project, NOHMs Technologies will optimize our proprietary
    ionic liquid electrolyte and demonstrate how the electrolyte provides safe, non-flammable
    high-energy performance and provides Li-metal protection. NOHMs will provide full
    cell data and analysis to demonstrate the feasibility of our system to meet NASA's
    'Far Term Mission' specific energy and energy density goals. The battery technology
    under development by NOHMs is capable of delivering batteries with specific energies
    that are three times higher than today's state of the art Li-ion battery systems.
    For NASA missions, this can be translated into increased operational range, functionality,
    or payload capabilities and significantly reduced operational cost. NASA applications.",nt"license_title":
